export const handleFilters = ({ minScore, level }) => {
    return {
        type: 'handleFilters',
        payload: {
            minScore,
            level
        }
    }
}

export const handleArrange = (arrange) => {
    return {
        type: 'handleArrange',
        payload: arrange
    }
}

export const updatePriceAuto = (price) => {
    return {
        type: 'updatePrice',
        payload: price,
    }
}

export const handlePower = ({ min, max }) => {
    return {
        type: 'handlePower',
        payload: {
            min,
            max
        }
    }
}

export const handleSort = (sort) => {
    return {
        type: 'handleSort',
        payload: sort,
    }
}

